import {Link} from 'react-router-dom';
import style from './css/footer.module.css';

const Footer = () => {
    return (
        <footer>
            <span className={style.brand}>The Indonesia Times</span>
            <Link to="">About</Link>
            <Link to="">Contact</Link>
            <Link to="">Terms</Link>
            <Link to="">Privacy Policy</Link>
        </footer>
    )
}

export default Footer;
